import React from "react";
import { useSelector } from "react-redux";

const Cart = () => {
  const cart = useSelector((state) => state.cart)
  return(
    <>
    <h1>Hello To Cart</h1>
       {cart.map((product)=>{
          return <h1 key={product.id}>{product.title}</h1>
       })}
    </>
  );
};

export default Cart;
